//            "content": "【支部简介】\r\n        二院基建部物业公司党支部现有3个党小组，党员27名。具有大专以上学历10人，其中高级工程师1名，工程师4名。平均年龄在45岁以上。这支不算年轻的党员队伍，承担着二院生活区等多个社区的物业管理工作，还负责住宅楼节能改造、社区道路维修建设等工程维修维护工作。\r\n                                                                              【典型做法】\r\n                                                                        营造氛围，提高学习成效\r\n        物业公司党支部根据实际情况，制定“两学一做”学习教育计划，把学习教育与本单位中心工作紧密结合起来。开展以党小组为单位的抄写党章接龙活动，使每个党员从抄写过程中加深对党章的理解，从党章的概述、党章的发展历程、党章的总纲、党章的条文、学习和遵守党章5个方面入手,仔细研读，深刻把握精神实质，准确领会要义内涵。支部联系领导、支部书记带头讲党课，结合学习内容，深入解读各项要求，帮助党员提高学习效果。党支部在开展学习的基础上，结合物业公司面临的内部和外部的困难，组织专题研讨，分析新形势下对物业公司管理、机制、文化、技术创新的要求，交流如何推动物业公司发展等公司发展问题，对照学习内容，党支部书记带头从自身找问题，剖析产生问题的原因，为支部党员做示范。党员结合自身岗位工作，认真查找问题，并积极制定整改措施。党支部鼓励每位党员联系岗位实际讲述自身开展学习教育的心得体会，注重运用身边实例、现身说法，强化互动交流、答疑解惑；针对每个专题特点，利用多种形式开展党内主题实践活动，如“回顾宣誓”“观看顺义焦庄户地道战遗址”“忆苦思甜”“观看二院反腐话剧《坚守》”等活动，进一步加强党员的党性锻炼；同时，鼓励支部党员通过微信群，及时发布学习教育相关文章，加深党员对学习内容的理解领悟。\r\n                                                                            知行合一，提升服务质量\r\n        立足岗位强服务。物业公司全体党员围绕学习内容，结合中心工作，为科研生产和职工生活提供服务保障，以饱满的精神状态和务实的工作作风，把学习教育落到实处，用服务质量提升来检验学习教育成效。党支部多次组织业主交流会，及时了解、掌握业主需求，对维修、缴费、门禁等问题及时处理。印制物业管理宣传手册，规范工作人员服务行为提高服务意识，加强与业主的沟通联系，提高服务满意度。在急、难、险、累的任务面前，党支部充分发挥党支部的战斗堡垒作用，号召党员发挥先锋模范作用，主动承担任务，加强夏季汛期重点区域的防汛保障，做好人员、物资等准备工作。在冬季供暖期间，支部党员主动要求增加锅炉、管线的巡检频次，加强全面检查和维护保养，及时抢修管道破裂等突发情况。对辖区内的空巢老人家庭和优抚家庭开展上门服务活动。为解决二院外场试验人员出门在外的后顾之忧，组织党员专门为试验人员提供预约服务，随时随地上门检查、维修。同时，党支部组织党员细化、量化服务管理标准，强化服务管理措施，提升物业管理科学化水平，在解决问题的基础上，打造了“想为、能为、敢为、善为”物业服务队伍，为做好物业服务保障工作奠定了基础。\r\n        争做先锋讲奉献。党支部号召党员发挥先锋模范作用，结合实际成立“党员应急突击队”，开展“讲奉献做先锋”活动，用党员的实际行动带动职工群众共同参与，营造了比学赶帮超的良好氛围；开展“为党旗增辉，为党徽添彩”主题签名活动，强化创优争先、服务为民的意识，用心用力做好物业管理工作；设立“党员示范岗”，让党员时刻牢记党员身份，自愿接受党组织、其他党员及职工群众的监督，打通党员与职工群众之间的沟通渠道，营造积极进取、发奋向上的良好氛围。\r\n                                                                              【工作成效】\r\n        在学习教育中，物业公司党支部发挥战斗堡垒作用，结合物业管理工作实际，围绕学习教育各项要求，开展了回顾宣誓、业主座谈会、讲奉献做先锋等活动，增强党员“四个意识”，通过党员立足岗位作贡献，完成了100余栋住宅楼结构改造工程、10栋老旧楼加装外挂电梯工程，为业主生活提供了有效的保障。期间，党支部收到业主送来的锦旗5面，表扬信8封，物业公司凭借优质的服务得到了业主的一致好评。",
